function pageNav(id) {
    var args = id.split('_');
    userSelect = false;
    id = args[0];
    var search = args[1];
    var root = $$("root");
    if (id == "") {
        root.addView({
            id: "mainPage",
            template: " 　"
        });
        userSelect = true;
        return;
    }
    var sidebar = $$("sidebar");
    sidebar.closeAll();
    for (var i = 0; i < menu.data.length; i++) {
        var item = menu.data[i];
        if (item.id == id) {
            sidebar.select(id);
            showPage(id, search);
            userSelect = true;
            return;
        }
        var submenu = item.data;
        if (!submenu)
            continue;
        for (var j = 0; j < submenu.length; j++) {
            if (submenu[j].id == id) {
                sidebar.open(menu.data[i].id);
                sidebar.select(id);
                showPage(id, search);
                userSelect = true;
                return;
            }
        }
    }
    userSelect = true;
}

